script: |
  super -f text -I q8124.spq | sort > q8124.out

inputs:
  - name: q8124.spq
    data: |
      SELECT ALL - col2 / + col2 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 49 - - col0 + - + 87 + - col2 / - 33 * - col2 + - - col0 >= NULL;
  - name: tab2

outputs:
  - name: q8124.out
    data: |
